import { Title,LogoImage} from "./styles";
import { image } from "../../resources/Images";


const Header:React.FC=()=> {

    return (
     <div>
     <Title>
      <LogoImage src={image.logo}></LogoImage>
      <img src={image.logo}></img>
      {/* </LogoImage> */}
      <div>{content.heading}</div>
      <div>{content.text}</div>
      
    
     </Title>
     </div>

    );
  }
  export default Header;
